import React from "react";
import '../App.scss';
import contact from '../contact.png';


const Contact = () => {
    return (
        <main class='mainsubgrid' data-router-wrapper>   
            <img class='contact__pic' src={contact} alt='contactpic'/>
            <div class='contact__content'>
                <div>T&nbsp;&nbsp;&nbsp;+639153904917</div>
                <br></br>
                <div>E&nbsp;&nbsp;&nbsp;jaypardelobate101994@gmail.com</div>
            </div>  


        </main>
    )
}

export default Contact;
